import "./hotelItem.css";
const HotelItem = (props) => {
  return (
    <div className="hotel__item col-3 my-5">
      <div className="hotel__item--image">
        <img src={props.img_url} width="100%" alt="" />
      </div>
    </div>
  );
};

export default HotelItem;
